'use client'
import React from "react";
import { Accordion, AccordionItem } from "@nextui-org/react";
import { IconEyes } from "@/shared/Components/Icons";
import LoadingErrorCard from "@/shared/Components/LoadingErrorCard";
import { TableSkeleton } from "@/shared/Components/Skeletons";
import Progress from "@/shared/Components/Progress";
import ActualizarPreguntaModal from "./Modals/Pregunta/ActualizarPreguntaModal";
import EliminarPreguntaButton from "./Buttons/EliminarPreguntaButton";
import OpcionesItem from "./OpcionesItem";
import OpcionesList from "./OpcionesList";

const preguntas = {

    error: false,
    isLoading: false,
    data: [
        {
            id: 1,
            grupo: "GRUPO 06",
            numeroPregunta: "PREGUNTA 30",
            pregunta: `<p>¿Cuál de los siguientes moldes debe usar?</p>`,
            enunciado: `<p className="ql-align-justify">Jorge quiere armar una caja de regalo como la que se ve a continuación:</p><p><img src="data:image/png;base64,"></p>`,

        },
        {
            id: 2,
            grupo: "GRUPO GENERAL",
            estado: 1,
            numeroPregunta: "PREGUNTA 01",
            pregunta: `<p>¿Cuál de los siguientes moldes debe usar?</p>`,
            enunciado: `<p className="ql-align-justify">Jorge quiere armar una caja de regalo como la que se ve a continuación:</p><p><img src="data:image/png;base64,"></p>`,
            estado: 1
        },

    ]
}
const itemClasses = {

    title: "font-bold  text-medium text-gray-700 ",
    subtitle: "text-xs text-gray-500",
};

export default function PreguntasAccordion() {

    if (preguntas.error) return <LoadingErrorCard />
    if (preguntas.isLoading) return <Progress />

    return (
        <Accordion itemClasses={itemClasses} variant="splitted" isCompact>

            {
                preguntas && preguntas?.data.map((pregunta, index) => (

                    <AccordionItem key={index} aria-label={index} indicator={<IconEyes />} subtitle={pregunta.grupo} title={pregunta.numeroPregunta}>
                        <section className="p-5" >
                            <section className=" mb-5 gap-4 flex items-center justify-end ">
                                <ActualizarPreguntaModal data={pregunta} />
                                <EliminarPreguntaButton data={pregunta} />
                            </section>
                            <div className="flex flex-col gap-6">
                                <div dangerouslySetInnerHTML={{ __html: pregunta.enunciado }} />
                                <div dangerouslySetInnerHTML={{ __html: pregunta.pregunta }} />
                            </div>
                        </section>
                        <div className="mt-5" >
                            <OpcionesList id={pregunta.id} />
                        </div>
                    </AccordionItem>

                ))
            }
        </Accordion>
    );
}
